import React, { Component } from "react";
import Signup from "./testCognitoComponents/Signup";
import Login from "./testCognitoComponents/Login";
import Status from "./testCognitoComponents/Status";
import { Account } from "./testCognitoComponents/Account";
import Settings from "./testCognitoComponents/Settings";

export default class TestCognito extends Component {

    render() {

        return (
            <div>
                <Account>
                    <Status />
                    <Signup />
                    <Login />
                    <Settings />
                </Account>
            </div>
        )

    };

};
